import React,{useState} from 'react';
import{
    Text,
View
} from 'react-native';
import tropicApi from '../api/baseApi';

const StudyTropicScreen = ({route})=>{
    const id = route.params.id;
    const [tropics,setTropics] = useState([]);

    if(id==1){
        const {data} = tropicApi.get('/get-bcs-tropics');
        setTropics(data);
    }

    return(
        <View>
            <Text>{route.params.title}</Text>
        </View>
    )

}

export default StudyTropicScreen;
